import React from 'react';

function About() {
  return (
    <div>
      <h2>About Us</h2>
      <p>Welcome to the Previous Year Question Papers website. This platform is designed to help students and job aspirants access past question papers for various government exams.</p>
      <p>Our mission is to provide a single, convenient repository for accessing these resources to aid in your preparation.</p>
      <a href="mailto:asrmuthu57@gmail.com">
                              asrmuthu57@gmail.com
                          </a>
    </div>
  );
}

export default About;
